   // const {datosBasicos, setDatosBasicos, datosClinicos, setDatosClinicos} = props
   const {datosBasicos, setDatosBasicos} = props
   
    return (

        <div>
          <DatosBasicos datosBasicos={datosBasicos} setDatosBasicos={setDatosBasicos}/>
        </div>
      
    )
}
